import requests, json
from bs4 import BeautifulSoup

def fetch_department_urls(catalog_url):
    print('Fetching department urls...')
    response = requests.get(catalog_url)
    soup = BeautifulSoup(response.content, 'html.parser')
    dept_links = soup.select('#atozindex ul li a')

    # Correctly forming the full URL for each department
    base_url = 'https://catalog.tamu.edu'
    departments = {}
    for link in dept_links:
        dept_code = link.text.split(' - ')[0].split()[0]
        if dept_code == "ESSM Ecosystem Science & Mgmt":
            dept_code = "ESSM"
            dept_url = "https://catalog.tamu.edu/undergraduate/course-descriptions/essm/"
        elif dept_code == "ENST-Environmental":
            dept_code = "ENST"
            dept_url = "https://catalog.tamu.edu/undergraduate/course-descriptions/enst/"
        else:
            dept_url = base_url + link['href']
        departments[dept_code] = dept_url
    return departments

def fetch_courses_for_department(dept_url):
    response = requests.get(dept_url)
    soup = BeautifulSoup(response.content, 'html.parser')
    course_blocks = soup.select('.courseblocktitle')
    courses = []

    for block in course_blocks:
        title_text = block.get_text()
        # Extracting department code and course number
        course_code = ' '.join(title_text.split()[:2])
        # Removing any additional info after "/"
        course_code = course_code.split('/')[0].strip()
        courses.append(course_code)
        print(course_code)

    return courses

def scrape_tamu_courses(target_depts):
    catalog_url = 'https://catalog.tamu.edu/undergraduate/course-descriptions/'
    departments = fetch_department_urls(catalog_url)
    all_courses = {}

    for dept, url in departments.items():
        if dept in target_depts:
            print(f'Fetching courses for {dept}...')
            all_courses[dept] = fetch_courses_for_department(url)

    return all_courses



