def convert_to_classes_format(course_dict):
    classes = []
    for dept, course_list in course_dict.items():
        for course in course_list:
            course_number = course.split()[1]  # Assumes the course code is always the second element
            classes.append({"dept": dept, "number": course_number})
    return classes

